"use strict";

// Operadores
// soma (+) 
console.log(3 + 5); // subtração (-)

console.log(3 - 5); // multiplicação (*)

console.log((3.5 * 3.05).toFixed(2));
console.log(3 * 5); // divisão (/)

console.log(10 / 5); // resto da divisão (%)

console.log(10 % 3); // incremento (++)

var increment = 18;
console.log(++increment); //decremento (--)

var increment2 = 18;
console.log(--increment2); //exponencial (**)

console.log(Math.pow(3, 3));